CREATE TABLE FoodPrices (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    price DECIMAL(10,2),
    date DATE
);

CREATE TABLE PricingStrategies (
    id INT PRIMARY KEY,
    strategy_name VARCHAR(255),
    min_price DECIMAL(10,2),
    max_price DECIMAL(10,2)
);

CREATE TABLE food_prices (
    id INT PRIMARY KEY,
    food_name VARCHAR(255) NOT NULL,
    price DECIMAL(10,2) NOT NULL,
    date_added DATE NOT NULL
);

CREATE TABLE Stores ( 
    id INT PRIMARY KEY, 
    store_name VARCHAR(255), 
    location VARCHAR(255) 
);

CREATE TABLE Affordability ( 
    id INT PRIMARY KEY, 
    product_id INT, 
    affordability_rank INT, 
    affordability_score DECIMAL(5,2) 
);
